import styled from "styled-components";

export const Header = styled.header`
  display: flex;
  flex-direction: row;
  justify-content: space-between;
`

export const NavigationContainer = styled.ul`
  list-style-type: none;
  display: flex;
  li {
    margin-right: 5px;
  }
`
